import React, { useState } from 'react';
import { View, Text, Switch, Pressable, StyleSheet } from 'react-native';
import {
  MD3LightTheme as DefaultTheme,
  PaperProvider, Button, Card
} from 'react-native-paper';
import { FlatList, SectionList } from 'react-native-web';
import books from './books.js';
console.log(books);

const App = () => {

  const list = [
    {
      'mark': 'TOYOTA',
      'model': "RAV4"
    },
    {
      'mark': 'BMW',
      'model': "E34"
    },
    {
      'mark': 'ZEEKR',
      'model': "001"
    },
    {
      'mark': 'Nissan',
      'model': "Qashqai"
    },
  ]

  const renderer = ({ item }) => {
    return (
      <Card>
        <Card.Title title={item.mark}></Card.Title>
        <Card.Content>
          <Text variant="bodyMedium">{item.model}</Text>
        </Card.Content>
      </Card>
    )
  }

  return (
    <PaperProvider theme={DefaultTheme}>
      <View style={{ flex: 1, fontSize: '30px', alignItems: 'center', justifyContent: 'center' }}>

        <SectionList
          sections={books.books}
          renderItem={renderer}
        >

        </SectionList>

      </View>
    </PaperProvider>
  );
}

export default App;
